func lengthOfLongestSubstring(s string) int {
	var left, longest int
	var right int = 0
	m := make(map[byte]int)

	for right < len(s) {
		if _, ok := m[s[right]]; ok {
			if longest < len(m) {
				longest = len(m)
			}

			for i := left; i <= m[s[right]]; i++ {
				index, _ := m[s[i]]
				if index < m[s[right]] {
					delete(m, s[i])
				}
			}
			left = m[s[right]] + 1
		}
		m[s[right]] = right
		right++
	}
	if longest < len(m) {
		longest = len(m)
	}

	return longest
}
